import React from "react";
import Footer from "./Footer";

import Topbar from "./Topbar";

type PropsType = {
  children: React.ReactNode;
};
function Layout(props: PropsType) {
  const { children } = props;

  return (
    <>
      <nav>
        <Topbar />
      </nav>

      <main>{children}</main>

      <footer>
        <Footer />
      </footer>
    </>
  );
}

export default Layout;
